#
# Structure for table "shhouse"
#

DROP TABLE IF EXISTS `shhouse`;
CREATE TABLE `shhouse` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL DEFAULT '0' COMMENT '用户id',
  `unique_number` varchar(32) NOT NULL DEFAULT '' COMMENT '唯一编号',
  `pictures` varchar(255) NOT NULL DEFAULT '' COMMENT '图片',
  `village_id` int(11) NOT NULL DEFAULT '0' COMMENT '小区id',
  `block` varchar(10) NOT NULL DEFAULT '' COMMENT '栋',
  `unit` varchar(10) NOT NULL DEFAULT '' COMMENT '单元',
  `house_num` varchar(10) NOT NULL DEFAULT '' COMMENT '门牌号',
  `build_area` smallint(6) NOT NULL DEFAULT '0' COMMENT '建筑面积',
  `carpet_area` tinyint(3) NOT NULL DEFAULT '0' COMMENT '室内面积',
  `storey` smallint(6) NOT NULL DEFAULT '0' COMMENT '楼层',
  `all_storey` smallint(6) NOT NULL DEFAULT '0' COMMENT '总楼层',
  `house_layout` varchar(10) NOT NULL DEFAULT '' COMMENT '户型',
  `room_amount` tinyint(3) NOT NULL DEFAULT '0' COMMENT '房间个数',
  `hall_amount` tinyint(3) NOT NULL DEFAULT '0' COMMENT '厅个数',
  `toilet_amount` tinyint(3) NOT NULL DEFAULT '0' COMMENT '卫生间个数',
  `balcony_amount` tinyint(3) NOT NULL DEFAULT '0' COMMENT '阳台个数',
  `transaction_type` varchar(15) NOT NULL DEFAULT '' COMMENT '交易类型',
  `price` int(11) NOT NULL DEFAULT '0' COMMENT '出售总价',
  `unit_price` int(11) NOT NULL DEFAULT '0' COMMENT '出售单价(总价除以建筑面积而来)',
  `lease_price` int(11) NOT NULL DEFAULT '0' COMMENT '出租价(元/月)',
  `house_master_name` varchar(15) NOT NULL DEFAULT '' COMMENT '房主姓名',
  `mobile_1` varchar(15) NOT NULL DEFAULT '' COMMENT '联系电话1',
  `mobile_2` varchar(15) NOT NULL DEFAULT '' COMMENT '联系电话2',
  `house_type` varchar(15) NOT NULL DEFAULT '' COMMENT '房屋类型',
  `property_nature` varchar(15) NOT NULL DEFAULT '' COMMENT '产权性质',
  `build_time` int(11) NOT NULL DEFAULT '0' COMMENT '建房时间',
  `trim_time` int(11) NOT NULL DEFAULT '0' COMMENT '装修时间',
  `installation` varchar(255) NOT NULL DEFAULT '' COMMENT '配套设施',
  `direction` varchar(15) NOT NULL DEFAULT '' COMMENT '房屋朝向',
  `trim_type` varchar(15) NOT NULL DEFAULT '' COMMENT '装修类型',
  `has_elevator` tinyint(3) NOT NULL DEFAULT '1' COMMENT '是否有电梯：1是0否',
  `down_payment_amount` int(11) NOT NULL DEFAULT '0' COMMENT '首付金额',
  `look_up` tinyint(3) NOT NULL DEFAULT '0' COMMENT '看房方式:0预约,1有钥匙',
  `key_address` varchar(50) NOT NULL DEFAULT '' COMMENT '钥匙所在地',
  `look_time` varchar(50) NOT NULL DEFAULT '' COMMENT '看房时间',
  `certificate` varchar(15) NOT NULL DEFAULT '' COMMENT '证件',
  `now_status` varchar(15) NOT NULL DEFAULT '' COMMENT '房屋现状',
  `pay_type` varchar(15) NOT NULL DEFAULT '' COMMENT '出售付款方式',
  `lease_pay_type` varchar(15) NOT NULL DEFAULT '' COMMENT '出租付款方式',
  `down_payment` varchar(15) NOT NULL DEFAULT '0' COMMENT '首付要求',
  `has_loan` tinyint(3) NOT NULL DEFAULT '0' COMMENT '是否有贷款:1是0否',
  `can_remove_by_youself` tinyint(3) NOT NULL DEFAULT '1' COMMENT '是否可以自行解除贷款：1是0否',
  `house_tag` varchar(255) NOT NULL DEFAULT '' COMMENT '房源标签',
  `buy_time` int(11) NOT NULL DEFAULT '0' COMMENT '购买时间',
  `master_remarks` varchar(255) NOT NULL DEFAULT '' COMMENT '房主备注信息',
  `agent_id` int(11) NOT NULL DEFAULT '0' COMMENT '经纪人id',
  `agent_remarks` varchar(255) NOT NULL DEFAULT '' COMMENT '经纪人备注',
  `only_house` varchar(10) NOT NULL DEFAULT '' COMMENT '是否家庭唯一住房',
  `house_mortgage` varchar(15) NOT NULL DEFAULT '' COMMENT '房屋抵押',
  `loan_remove_type` varchar(15) NOT NULL DEFAULT '' COMMENT '贷款解押方式',
  `loan_type` varchar(15) NOT NULL DEFAULT '' COMMENT '贷款类型',
  `loan_amount` varchar(15) NOT NULL DEFAULT '' COMMENT '贷款总额',
  `property_card` varchar(15) NOT NULL DEFAULT '' COMMENT '产权证',
  `property_have` varchar(15) NOT NULL DEFAULT '' COMMENT '产权所有',
  `property_people_address` varchar(15) NOT NULL DEFAULT '' COMMENT '产权人所在地',
  `property_people_age` varchar(15) NOT NULL DEFAULT '' COMMENT '产权人年龄',
  `seal_up` varchar(15) NOT NULL DEFAULT '' COMMENT '查封',
  `start_time` int(11) NOT NULL DEFAULT '0' COMMENT '上架时间',
  `end_time` int(11) NOT NULL DEFAULT '0' COMMENT '下架时间',
  `weight` int(11) NOT NULL DEFAULT '0' COMMENT '权重：数值越大权重越高',
  `is_suggest` tinyint(3) NOT NULL DEFAULT '0' COMMENT '是否推荐：1是0否',
  `create_time` int(11) NOT NULL DEFAULT '0',
  `update_time` int(11) NOT NULL DEFAULT '0',
  `is_show` tinyint(3) NOT NULL DEFAULT '0' COMMENT '房源上下架,1上0下',
  `check_status` tinyint(3) NOT NULL DEFAULT '0' COMMENT '审核状态：0待审核，1审核通过，2审核不通过',
  `refuse_reason` varchar(50) NOT NULL DEFAULT '' COMMENT '审核不通过原因',
  `status` tinyint(3) NOT NULL DEFAULT '1' COMMENT '房屋状态：1正常0已删除',
  PRIMARY KEY (`id`),
  UNIQUE KEY `unique_number` (`unique_number`) COMMENT '房源编号唯一'
) ENGINE=InnoDB AUTO_INCREMENT=13 DEFAULT CHARSET=utf8 COMMENT='二手房房源信息';

