  `id` int(11) NOT NULL AUTO_INCREMENT,
  `unique_identify` varchar(30) DEFAULT NULL COMMENT '唯一标识,避免数据直接依赖id',
  `parent_id` int(11) NOT NULL DEFAULT '0' COMMENT '上级分类id',
  `level` tinyint(3) NOT NULL DEFAULT '1' COMMENT '分类等级,顶级为1',
  `name` varchar(30) NOT NULL DEFAULT '' COMMENT '分类名称',
  `description` varchar(255) NOT NULL DEFAULT '' COMMENT '分类描述',
  `icon` int(11) NOT NULL DEFAULT '0' COMMENT '分类图标',
  `out_link` varchar(255) NOT NULL DEFAULT '' COMMENT '外链',
  `weight` int(11) NOT NULL DEFAULT '0' COMMENT '权重',
  `create_time` int(11) NOT NULL DEFAULT '0',
  `update_time` int(11) NOT NULL DEFAULT '0',
  `status` tinyint(3) NOT NULL DEFAULT '1' COMMENT '状态：1可用，0禁用',
  PRIMARY KEY (`id`),
  UNIQUE KEY `unique_identify` (`unique_identify`)
) ENGINE=InnoDB AUTO_INCREMENT=39 DEFAULT CHARSET=utf8 COMMENT='系统分类';

